import { DataChart } from 'grommet';
import React from 'react'

export const Stats = () => {
    return ( 
        <DataChart series = {
            ['date', 'amount']
        }
        data = {
            [{
                    date: '2020-05-26',
                    amount: 66
                },
                {
                    date: '2020-05-27',
                    amount: 77
                },
                {
                    date: '2020-05-28',
                    amount: 88
                },
            ]
        }
        />
    )
}

export default Stats
